import PosData from "./positionData";
import Vector2 from "../Vector2";

let positions = new Map();
positions.set("draggable-0", { x: 0, y: 0 });
positions.set("draggable-1", { x: 0, y: 0 });
positions.set("draggable-2", { x: 0, y: 0 });
positions.set("draggable-3", { x: 0, y: 0 });
positions.set("draggable-4", { x: 0, y: 0 });
positions.set("draggable-5", { x: 0, y: 0 });
positions.set("draggable-6", { x: 0, y: 0 });
positions.set("draggable-7", { x: 0, y: 0 });
positions.set("draggable-8", { x: 0, y: 0 });
positions.set("draggable-9", { x: 0, y: 0 });
positions.set("draggable-10", { x: 0, y: 0 });
positions.set("draggable-11", { x: 0, y: 0 });
export function GetPositionData(id) {
  if (positions.has(id)) {
    return positions.get(id);
  } else return null;
}
export function UpdatePositionData(id, x, y) {
  if (positions.has(id)) {
    positions.set(id, x, y);
  }
}
